import React from "react";
import ReactDelayRender from "react-delay-render";
import FadeIn from "react-fade-in";
import Collapsible from "react-collapsible";

import SkillItem from "./SkillItem/SkillItem";

import "./Skills.css";

const Skills = () => {
  return (
    <FadeIn>
      <div className="skills__wrapper">
        <Collapsible trigger="Technical Skills">
          <p className="skills__paragraph">
            Here is a list of things I know about and absolutely subjective
            scale of my familiarity with them:
          </p>
          <SkillItem skill="React.js" level="4"></SkillItem>
        </Collapsible>
        <Collapsible trigger="Other Skills">
          <p className="skills__paragraph">
            Here a couple of other skills that I have gained throughout my
            career:
            <ul>
              <li>Cross-departamental cooperation</li>
            </ul>
          </p>
        </Collapsible>
        <Collapsible trigger="Hobbies/Interests">
          <p className="skills__paragraph">
            My main hobbies include weightlifting, video and board games,
            cooking and comedy of many sorts. Outside of web development, my
            passions include nutrition science, fitness and evolutionary
            psychology, video games industry. I love problem-solving and puzzles
            of all sorts and I am an active member of British Mensa.
          </p>
        </Collapsible>
      </div>
    </FadeIn>
  );
};

export default ReactDelayRender({ delay: 401 })(Skills);
